<span class="line"><span style="color:#A6ACCD;">    print(&#39;\u83B7\u53D6\u5230\u7684\u72B6\u6001\u662F\uFF1A&#39;+str(hjson[&#39;code&#39;])+&#39;\uFF0C\u9884\u671F\u7684\u72B6\u6001\u662F\uFF1A&#39;+hcodehope)</span></span>
